export default class CheckoutList extends Component {
    render() {
        return (
            <ProductConsumer>
            {
                value => {
                    const cart = value;
                    if(cart && cart.length !== 0){
                        return(
                            <div className="form-wrapper-cart">
                                <div className="form-container">
                                    <div className="btns">
                                        <Link to="/cart">
                                            <button className="btn-primary-red">Back to cart</button>
                                        </Link>
                                        <button className="btn-primary-green">buy now</button>
                                    </div>
                                </div>
                            </div>
                        )
                    }else
                        return <Error></Error>
                }
            }
            </ProductConsumer>
        )
    }
}
